INSERT INTO `t_food` VALUES (75, 16, '满减主食', '双层热辣堡', '优质大块鸡腿排，裹粉炸制，鲜嫩多汁，香辣劲爆。（香辣味）', 'http://p0.meituan.net/wmproduct/410aa2c87ff130ebb3ee6388414471df333011.jpg', 9999, 5, 421, 15.00, 15.00, 0);
INSERT INTO `t_food` VALUES (76, 16, '满减主食', '香辣鸡腿堡', '嫩滑多汁的鸡腿肉，腌入正宗川味麻辣酱料，淋上奶香沙拉，配上爽脆的有机蔬菜，是我们最叫卖的美味食品哦。', 'http://p0.meituan.net/wmproduct/eeb92980a77a9ff8b500ad9ced15f5d8288993.jpg', 9999, 10, 597, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (77, 16, '满减主食', '秘制烤鸡腿堡', '新鲜嫩滑的鸡腿肉，腌入华莱士秘制五味料，烹制后再淋上一层秘制酱料，配以爽脆的有机蔬菜，味道浓郁，咬一口满满腌制的鸡腿肉，味道就是一个赞字', 'http://p1.meituan.net/wmproduct/af8f8f1af57636eb99489d1bf5699901313619.jpg', 9999, 2, 149, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (78, 16, '满减主食', '香鸡堡', '优质大块鸡腿肉，裹粉炸制，鲜嫩多汁，香脆劲爆。（不辣）', 'http://p0.meituan.net/wmproduct/eeb92980a77a9ff8b500ad9ced15f5d8288993.jpg', 9999, 2, 76, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (79, 16, '满减主食', '鳕鱼堡', '来自深海的馈赠，远离城市的污染，是大自然为我们准备的美味可口的鳕鱼，鲜嫩多汁的美味尽在华莱士餐厅。', 'http://p0.meituan.net/wmproduct/f9fe75e21b3662e0325a9b1abcdb5e7c620744.png', 9999, 3, 111, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (80, 16, '满减主食', '牛气冲天堡', '精选地道的牛肉饼，煎烤烹制，撒上特制佐酱和酸酸甜甜的番茄汁，搭配清新的蔬菜，美味就在眼前。便宜实惠，酱料足，牛肉饼厚，烤的香，吃着还不油腻。', 'http://p1.meituan.net/wmproduct/9e4be91d9bfa224e21d00ed4359a3395679153.png', 9999, 4, 109, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (81, 16, '满减主食', '泰式鸡肉卷', '选用无骨鸡腿肉烤制，鲜嫩多汁，甜中带辣。', 'http://p0.meituan.net/wmproduct/08b80e8525387e1e0bbaac9fc9843cf0439561.png', 9999, 1, 210, 14.00, 14.00, 0);
INSERT INTO `t_food` VALUES (82, 16, '满减小食', '小薯条', '采用上等马铃薯，精心烹炸而成。\n温馨提示：保质期只有7分钟！外送因为配送的原因会变软，口感会变差，介意的朋友请慎点！！！', 'http://p0.meituan.net/wmproduct/0c438a782e2a963ef32de71907805d95182643.jpg', 9999, 16, 640, 8.00, 8.00, 0);
