INSERT INTO `t_food` VALUES (88, 16, '满减小食', '玉米杯', '大杯甜玉米，饱满多汁，粒粒金黄，粒粒香！甜！爽！据说强迫症吃玉米一定要一排一排地啃，绝不漏掉一粒种子！', 'http://p1.meituan.net/wmproduct/fef6812f677e0e487eb2aea248c9cbcb154268.jpg', 9999, 2, 193, 6.00, 6.00, 0);
