INSERT INTO `t_food` VALUES (256, 18, '盖浇饭', '酸辣土豆丝儿', '酸辣土豆丝是一道色香味俱全的汉族菜式。此菜是老百姓餐桌上最常见的家常菜。其主料土豆性平和胃，有改善肠胃功能、预防高血压的功效。辅料辣椒富含维生素C，可增强体力、冠状动脉硬化。', 'http://p0.meituan.net/xianfudwm/289ddb2437d7576a4a7c1a2003c8a84f206131.jpg', 9999, 3, 101, 8.00, 8.00, 0);
