INSERT INTO `t_food` VALUES (259, 18, '盖浇饭', '青椒肉丝', '无论是在街边饭馆里，还是在普通的家常饭桌上，总可以看到它的身影，它是那么的符合众人的口味，那么满足你挑剔的味蕾。', 'http://p1.meituan.net/xianfudwm/4d5550737d768c52f7346a4fe4cad7d4132643.jpg', 9999, 2, 51, 13.00, 13.00, 0);
INSERT INTO `t_food` VALUES (260, 18, '盖浇饭', '韭菜炒蛋', '韭菜中除含有蛋白质、脂肪、碳水化合物，\n最有价值的是含有丰富的胡萝卜素与维生素C，\n在蔬菜中处于领先地位；此外，还有钙、磷、铁等矿物质。\n现代医学研究证明，韭菜除了含较多的纤维素，能增强肠胃蠕动，\n对预防肠癌有极好的效果外，也含有挥发性精油及含硫化合物，\n更具降低血脂的作用，所以食用韭菜对高血脂及冠心病患者颇有好处。也是中医常用的药物。是卫生部确定的“食药同源\"的食品之一。', 'http://p1.meituan.net/xianfudwm/8570669b9291778c390c22f1a2d40540196460.jpg', 9999, 1, 15, 11.00, 11.00, 0);
