INSERT INTO `t_food` VALUES (1934, 46, '品牌故事', '品牌故事', '《周先生的饭》起源于江苏省，创始人周勇一位励志的90后，17岁开始创业，，18岁便开了四家餐饮连锁店。21岁创办公司，22岁受邀参加CCTV4《走遍中国》，分享创业故事。23岁进入外卖市场，创办周鲜生餐饮管理有限公司，商标《周先生的饭》，仅用半年的时间，分店就遍布全国30余座城市和地区，所打下的天下，就是您舌尖上的那一点领地，愿我们的外卖给您带去美味的享受，愿周先生的精神助您勇闯未来的饭。', 'http://p0.meituan.net/wmproductdwm/e4ecc5cb83fab58e673fc08cc900b4d763921.jpg', 9999, 0, 0, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (1935, 46, '品牌故事', '为他点赞感恩', '无论刮风下雨，无论严寒酷暑，我们的快递小哥永远以最快的速度和最甜美的笑容为您送餐，他们的辛苦我看在眼里，您也吃在嘴里，为爱行动，周先生所有门店在寒冷的冬天，为小哥免费提供一杯暖暖的茶，在炎热的夏天，会准备一份降暑的夏饮，爱心一小步，温暖如春风。', 'http://p1.meituan.net/wmproductdwm/f9f4c4da29e09906586c6989bdc98fd8403988.jpg', 9999, 0, 4, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (1936, 46, '品牌故事', '对品质我们是认真的', '我们已经为您的健康护航，多一份呵护，就多一份安全。', 'http://p0.meituan.net/wmproductdwm/ca256a5d7f116c1b883d7a716b391492111327.jpg', 9999, 0, 0, 0.00, 0.00, 0);
