INSERT INTO `t_food` VALUES (3475, 35, '你得知道的事', '购买须知', '若有任何疑问，均可以致电平台显示的商家电话，我们一定会妥善处理的！', 'http://p0.meituan.net/wmproductdwm/573638176fbd99da43203d1e6ddbb6bc83988.jpg', 9999, 0, 0, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (3476, 35, '你得知道的事', '配送须知', '本店采用第三方配送平台配送，送达的时间与配送距离成正比，高峰期请提前下单哦！', 'http://p0.meituan.net/wmproductdwm/c04ec7441b5210e53f25d6bc00c4d39c103701.jpg', 9999, 0, 0, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (3477, 35, '你得知道的事', '合作热线', '目前我们已在西安、武汉、郑州、成都、兰州、宝鸡、咸阳、安康等多个城市开店，城市合伙人持续招募中，详情可致电15029011108.', 'http://p0.meituan.net/wmproductdwm/21790440d90fc46eea4bc9cf3b031d4782263.jpg', 9999, 0, 0, 0.00, 0.00, 0);
