INSERT INTO `t_food` VALUES (3479, 35, '煲煲有话说', '进口鲜活肉蟹展示', '煲哥承诺，本店所有螃蟹，均为纯进口鲜活肉蟹，肉质鲜嫩，拒绝冻蟹及死蟹。', 'http://p1.meituan.net/wmproductdwm/19a7e6c4b3047ef33f03714db4bbf712184660.jpg', 9999, 0, 0, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (3480, 35, '煲煲有话说', '出品总监旭哥承诺', '旭哥承诺，所有食材及酱料均符合卫生生产许可。煲类产品属于蟹煲哥品牌独立研发，不抄袭别人，但也不建议别人抄袭，本着用心对客的态度，做好自己的产品，总会有人认可', 'http://p0.meituan.net/wmproductdwm/52f3814256e456db40e79fb8b79e6037266596.jpg', 9999, 0, 0, 0.00, 0.00, 0);
INSERT INTO `t_food` VALUES (3481, 35, '煲煲有话说', '门店店长顺哥承诺', '顺哥承诺，每一份煲我们都会按照标准量制作，希望能得到各位亲爱的顾客认可，若拿到餐品，口味或服务有不合意的地方，请您及时与我取得联系，我将竭诚为您服务。如果我们表现的还不错，请记得为我们点赞鼓励一下哟。', 'http://p1.meituan.net/wmproductdwm/9e0f66d7f01c70452189cded9fb30131199561.jpg', 9999, 0, 0, 0.00, 0.00, 0);
